import React from 'react'

const Service = () => {
  return (
    <div className='mb w-screen grid grid-cols-4 gap-4'>
        <div className='w-[100%] h-[100px] bg-colorCyan rounded-lg'>1</div>
        <div className='w-[100%] h-[100px] bg-colorCyan rounded-lg'>2</div>
        <div className='w-[100%] h-[100px] bg-colorCyan rounded-lg'>3</div>
        <div className='w-[100%] h-[100px] bg-colorCyan rounded-lg'>4</div>
    </div>
  )
}

export default Service
